import React, { Component } from 'react';

class CalenderComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            weeks: ['日', '月', '火', '水', '木', '金', '土']
        }
    }
    render() {
        return (
            <table>
                <tr>
                    {this.state.weeks.map(day =>
                        <td>{day}</td>)}
                </tr>
                <td>
                    date:??
            </td>
            </table>
        )
    }
}

function day() {
    return (
        <div></div>
    );
}
export default CalenderComponent;
